DROP TABLE IF EXISTS `gzh_charge_info`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `gzh_charge_info` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `charge_record_id` int(10) unsigned NOT NULL COMMENT '收费记录ID',
  `spot_id` int(10) unsigned NOT NULL COMMENT '诊所ID',
  `record_id` int(10) unsigned NOT NULL COMMENT '就诊流水ID',
  `type` tinyint(3) unsigned NOT NULL COMMENT '收费项类型(1-实验室检查,2-辅助检查,3-治疗,4-处方,5-诊疗费)',
  `outpatient_id` int(10) unsigned NOT NULL COMMENT '门诊ID',
  `name` varchar(64) NOT NULL DEFAULT '' COMMENT '收费项名称',
  `unit` varchar(16) NOT NULL DEFAULT '' COMMENT '单位',
  `unit_price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '单价',
  `num` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '数量',
  `doctor_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '接诊医生',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '状态(0-未收费,1-已收费,2-已退费)',
  `reason` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '退费原因',
  `reason_description` varchar(255) NOT NULL DEFAULT '' COMMENT '退费原因说明',
  `create_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `charge_record_id` (`charge_record_id`),
  KEY `outpatient_id` (`outpatient_id`),
  KEY `doctor_id` (`doctor_id`),
  KEY `record_id` (`record_id`),
  KEY `spot_id` (`spot_id`),
  KEY `status` (`status`),
  CONSTRAINT `gzh_charge_info_ibfk_1` FOREIGN KEY (`charge_record_id`) REFERENCES `gzh_charge_record` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=1213 DEFAULT CHARSET=utf8 COMMENT='收费详情表';
/*!40101 SET character_set_client = @saved_cs_client */;

