DROP TABLE IF EXISTS `gzh_code`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `gzh_code` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `user_id` int(10) unsigned NOT NULL COMMENT '用户id',
  `type` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '短信类型(1-注册,2-重置密码)',
  `iphone` char(11) NOT NULL DEFAULT '' COMMENT '手机号码',
  `code` int(10) unsigned NOT NULL COMMENT '验证码',
  `expire_time` int(10) unsigned NOT NULL COMMENT '有效期',
  `spot_id` int(10) unsigned NOT NULL COMMENT '机构id',
  `create_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`,`spot_id`,`iphone`,`type`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=41 DEFAULT CHARSET=utf8 COMMENT='手机短信验证码表';
