--
-- Table structure for table `gzh_cure_record`
--

DROP TABLE IF EXISTS `gzh_cure_record`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `gzh_cure_record` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `record_id` int(10) unsigned NOT NULL COMMENT '流水ID',
  `spot_id` int(10) unsigned NOT NULL COMMENT '诊所ID',
  `name` varchar(64) NOT NULL DEFAULT '' COMMENT '治疗医嘱名',
  `unit` varchar(16) NOT NULL DEFAULT '' COMMENT '单位',
  `price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '零售价',
  `time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '次数',
  `description` varchar(255) NOT NULL DEFAULT '' COMMENT '说明',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '3' COMMENT '状态(1-已完成,2-执行中,3-未执行)',
  `remark` varchar(255) NOT NULL DEFAULT '' COMMENT '备注',
  `cure_in_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '治疗中状态变更时间',
  `cure_finish_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '治疗完成状态变更时间',
  `report_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '报告时间',
  `report_user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '报告人',
  `create_time` int(10) unsigned NOT NULL COMMENT '创建时间',
  `update_time` int(10) unsigned NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `record_id` (`record_id`),
  KEY `spot_id` (`spot_id`,`name`),
  KEY `status` (`status`),
  KEY `create_time` (`create_time`),
  KEY `report_user_id` (`report_user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=222 DEFAULT CHARSET=utf8 COMMENT='门诊患者-治疗信息表';
/*!40101 SET character_set_client = @saved_cs_client */;

