CREATE TABLE `gzh_inspect_record` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `record_id` int(10) unsigned NOT NULL COMMENT '流水ID',
  `spot_id` int(10) unsigned NOT NULL COMMENT '诊所ID',
  `name` varchar(64) NOT NULL DEFAULT '' COMMENT '检验医嘱名',
  `unit` varchar(64) NOT NULL DEFAULT '' COMMENT '单位',
  `price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '零售价',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '3' COMMENT '状态(1-已完成,2-执行中,3-未执行)',
  `report_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '报告时间',
  `report_user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '报告人',
  `inspect_in_time` int(10) unsigned NOT NULL COMMENT '检查中状态变更时间',
  `inspect_finish_time` int(10) unsigned NOT NULL COMMENT '检查完成状态变更时间',
  `create_time` int(10) unsigned NOT NULL COMMENT '创建时间',
  `update_time` int(10) unsigned NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `record_id` (`record_id`),
  KEY `spot_id` (`spot_id`),
  KEY `status` (`status`),
  KEY `create_time` (`create_time`),
  KEY `report_user_id` (`report_user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=318 DEFAULT CHARSET=utf8 COMMENT='门诊患者-实验室检查信息表';
