  `update_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `inspect_record_id` (`inspect_record_id`),
  KEY `spot_id` (`spot_id`,`record_id`),
  CONSTRAINT `gzh_inspect_record_union_ibfk_1` FOREIGN KEY (`inspect_record_id`) REFERENCES `gzh_inspect_record` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=348 DEFAULT CHARSET=utf8 COMMENT='门诊患者-实验室检查关联项目表';
