INSERT INTO `gzh_medicine_item` VALUES (3,3,'Antibiotic-associated diarrhea; Prophylaxis',' Study dose: 250 mg 2 times daily within 24 hours of starting oral or IV antibiotics and continue for the duration of antibiotic therapy','Study dose: 250 mg 2 times daily within 24 hours of starting oral or IV antibiotics and continue for the duration of antibiotic therapy ','','patients with central line (ie, central venous catheters, peripherally inserted central catheters, or ports) due to increased risk of fungemia transmission; discontinuation or central line removal may be required；hypersensitivity to yeasts, especially Saccharomyces boulardii','Exanthematous disorder；Pruritus；Constipation；Flatulence；Fungemia；Angioedema','','','',0,0),(4,3,'Diarrhea, acute','Study dose (2 months to 12 years): 250 to 750 mg per day for 5 to 6 days；Usual dose, 2 months or older, Florastor(R): 250 to 500 mg (1 or 2 powder packets) twice daily ；Usual dose, children and infants, Perenterol(R): 100 mg 3 times daily, which may be increased to 200 mg 4 times daily ','Study dose (2 months to 12 years): 250 to 750 mg per day for 5 to 6 days；Usual dose, 2 months or older, Florastor(R): 250 to 500 mg (1 or 2 powder packets) twice daily ；Usual dose, children and infants, Perenterol(R): 100 mg 3 times daily, which may be increased to 200 mg 4 times daily ','','patients with central line (ie, central venous catheters, peripherally inserted central catheters, or ports) due to increased risk of fungemia transmission; discontinuation or central line removal may be required；hypersensitivity to yeasts, especially Saccharomyces boulardii','Exanthematous disorder；Pruritus；Constipation；Flatulence；Fungemia；Angioedema','','','',0,0),(5,4,'Cardiac transplant rejection, In combination with corticosteroid; Treatment and Prophylaxis','(6 months or older) initial, 15 mg/kg ORALLY or 5 to 6 mg/kg IV as a single daily dose, with first dose 4 to 12 hours before transplant; continue once daily dose for 1 to 2 weeks; switch from IV to oral administration as soon as possible postoperatively；(6 months or older) maintenance, decrease by 5% per week to 5 to 10 mg/kg/day ORALLY and continue based on clinical response, predefined blood concentrations, and tolerability; children have required and tolerated higher doses than those used in adults; administer IV dose at one-third the oral maintenance dose when patient is unable to tolerate oral formulation ；adjunctive adrenal corticosteroid therapy is recommended.','Nephrotoxicity in heart, liver, or kidney transplant recipients: Reduce dosage and follow clinical response, blood levels, and tolerability；Nephrotoxicity in rheumatoid arthritis: If serum creatinine (SCr) rises greater than 30% above baseline, reduce daily dose in decrements of 0.5 to 0.75 mg/kg/day; if SCr returns to less than or equal to 30% above baseline, may continue cycloSPORINE therapy; if SCr remains greater than 30% above baseline, withhold cycloSPORINE for 1 month and resume cycloSPORINE therapy if SCr returns to less than or equal to 15% above baseline value (guideline dosage)；','Hepatic impairment: May require lower doses to maintain cycloSPORINE blood concentrations in the recommended range ','Active ocular infections (ophthalmic emulsion)；Hypersensitivity to cycloSPORINE or any of ingredient in the formulation of the product；including polyoxyethylated castor oil (Cremophor(R) EL) in Sandimmune(R) injection','Common：Cardiovascular: Hypertension (13% to 53% )，Dermatologic: Hirsutism (21% to 45% )，Gastrointestinal: Drug-induced gingival hyperplasia (4% to 16% )，Neurologic: Headache (2% to 15% ), Tremor (12% to 55% )，Ophthalmic: Burning sensation in eye (Ophthalmic route, 17% )；Serious：Endocrine metabolic: Hyperkalemia, Hypomagnesemia，Hepatic: Hepatotoxicity (7% or less )，Immunologic: Disease due to Polyomavirus，Neurologic: Encephalopathy, Progressive multifocal leukoencephalopathy, Seizure (1% to 5% )，Renal: Hemolytic uremic syndrome, Nephrotoxicity (25% to 38% )，Other: Infectious disease。','C级',' Infant risk cannot be ruled out.','Only physicians experienced in management of systemic immunosuppressive therapy for the indicated disease should prescribe Sandimmune(R) (cycloSPORINE) and Neoral(R) (cycloSPORINE, modified). CycloSPORINE should be administered with adrenal corticosteroids but not with other immunosuppressive agents. Increased susceptibility to infection and the possible development of lymphoma may result from immunosuppression. CycloSPORINE and cycloSPORINE, modified are not bioequivalent and cannot be used interchangeably without physician supervision. CycloSPORINE absorption is erratic during chronic administration of Sandimmune(R) capsules and oral solution. Monitor cycloSPORINE blood levels to avoid toxicity due to high concentrations and possible organ rejection due to low levels ',0,0),(6,4,'Keratoconjunctivitis sicca','(16 years or older, ophthalmic emulsion) Instill 1 drop in each eye twice daily, approximately 12 hours apart','同上','同上','同上','同上','C级',' Infant risk cannot be ruled out.','同上',0,0),(7,4,'Liver transplant rejection, In combination with corticosteroid; Treatment and Prophylaxis','(6 months or older) initial, 15 mg/kg ORALLY or 5 to 6 mg/kg IV as a single daily dose, with the first dose 4 to 12 hours before transplant; continue once-daily dose for 1 to 2 weeks; switch from IV to oral administration as soon as possible postoperatively；(6 months or older) maintenance, decrease by 5% per week to 5 to 10 mg/kg/day ORALLY and continue based on clinical response, predefined blood concentrations, and tolerability; children have required and tolerated higher doses than those used in adults; administer IV dose at one-third the oral maintenance dose when patient is unable to tolerate oral formulation；adjunctive adrenal corticosteroid therapy is recommended 。','','同上','同上','同上','C级',' Infant risk cannot be ruled out.','同上',0,0),(8,4,'Renal transplant rejection, In combination with corticosteroid; Treatment and Prophylaxis','(6 months or older) initial, 15 mg/kg ORALLY or 5 to 6 mg/kg IV as a single daily dose, with the first dose 4 to 12 hours before transplant; continue once daily dose for 1 to 2 weeks; doses as low as 10 to 14 mg/kg/day ORALLY have been used; switch from IV to oral administration as soon as possible postoperatively；(6 months or older) maintenance, decrease by 5% per week to 5 to 10 mg/kg/day ORALLY and continue based on clinical response, predefined blood concentrations, and tolerability; children have required and tolerated higher doses than those used in adults; administer IV dose at one-third the oral maintenance dose when patient is unable to tolerate oral formulation；adjunctive adrenal corticosteroid therapy is recommended。','同上','同上','同上','同上','C级',' Infant risk cannot be ruled out.','同上',0,0),(9,4,'Urticaria, chronic, Refractory, in combination with antihistamine','','同上','同上','同上','同上','C级',' Infant risk cannot be ruled out.','同上',0,0),(10,4,'Pure red cell aplasia','','同上','同上','同上','同上','C级',' Infant risk cannot be ruled out.','同上',0,0),(11,4,'Nephrotic syndrome','','同上','同上','同上','同上','C级',' Infant risk cannot be ruled out.','同上',0,0),(12,5,'Constipation','The recommended dose for children younger than 6 years of age of glycerin suppositories to promote fecal evacuation is 1 to 1.5 grams；suppositories should be retained for 15 minutes ','','','Hypersensitivity to any component in the preparation','','C级',' Infant risk cannot be ruled out.','',0,0),(13,6,'Constipation','(6 months to 3 years) 5 to 10 mL (3.33 to 6.66 grams lactulose) ORALLY daily','diarrhea in children: reduce the dose immediately and if diarrhea persists, discontinue therapy ','','','Common：Gastrointestinal: Bloating symptom, Diarrhea, Epigastric pain, Flatulence, Nausea, Vomiting；Musculoskeletal: Cramp..Serious：Endocrine metabolic: Hypernatremia, Hypokalemia','B级',' Infant risk cannot be ruled out.','',0,0),(16,9,'Asthma','Bronchospasm, metered-dose inhaler, 4 years or olde