 mg 4 times a day (maximum total daily dose 32 mg) ；patients with sensitivity to beta-adrenergic stimulators: begin therapy at 2 mg ORALLY 3 or 4 times daily; may gradually increase to a maximum of 8 mg 4 times a day (maximum total daily dose 32 mg) 。','','Hypersensitivity to albuterol or any of its components；including milk proteins，or levalbuterol.','Common：Cardiovascular: Tachycardia (Less than 3% to 7% )；Gastrointestinal: Nausea (10% ), Pharyngitis (14% ), Viral gastroenteritis (1% ), Vomiting (Combined adult and pediatric, 7% ; pediatric, 3% )Musculoskeletal: Backache (2% )Neurologic: Feeling nervous (7% ), Headache (5% to 7% or more ), Sinus headache (1% ), Tremor (5% to 7% or more )Renal: Urinary tract infectious disease (1% )Respiratory: Bronchitis (5% or more ), Cough (5% or more ), Nasopharyngitis (Combined adult and pediatric, 5% or more; pediatric, 2% ), Pain in throat (Combined adult and pediatric, 5% or more; pediatric, 2% ), Rhinitis (5% to 16% ), Sinusitis (5% or more ), Upper respiratory infection (5% to 21% or more )Serious：Cardiovascular: Angina, Atrial fibrillation, Chest pain (3% ), ECG: extrasystole, Electrocardiogram abnormal, Hypertension, Hypotension, Myocardial infarction, Palpitations (5% or more ), Supraventricular tachycardia；Endocrine metabolic: Diabetic ketoacidosis, Hyperglycemia，Immunologic: Hypersensitivity reaction (6% )，Respiratory: Bronchospasm, Exacerbation of asthma, Paradoxical bronchospasm, Pulmonary edema。','C级',' Infant risk cannot be ruled out.','',0,0),(17,9,'Exercise-induced asthma; Prophylaxis','Metered-dose inhaler, 4 years or older (Proventil(R), Ventolin(R), ProAir(R) HFA aerosols, (ProAir(R) Respiclick(TM) powder): 2 oral inhalations (90 mcg albuterol base/actuation) 15 to 30 minutes prior to exercise ','同上','','同上','同上','C级',' Infant risk cannot be ruled out.','',0,0),(18,9,'Hyperkalemia','','同上','','同上','同上','C级',' Infant risk cannot be ruled out.','',0,0),(19,9,'Respiratory distress syndrome in the newborn, Premature','','同上','','同上','同上','C级',' Infant risk cannot be ruled out.','',0,0),(20,10,'Chronic obstructive pulmonary disease','(inhalation solution 0.02%) 12 y of age and older, 500 mcg NEBULIZED 3 to 4 times/day per day; separate doses by 6 to 8 hours','','','hypersensitivity to atropine or its derivatives；hypersensitivity to ipratropium bromide or any other component of the product','Common：Gastrointestinal: Abnormal taste in mouth, Bitter (up to 3.7% ), Xerostomia (up to 4.1% )，Respiratory: Bronchitis (oral inhalation, 10% to 23% ), Nasal mucosa dry (nasal spray, 4.6% to 5.1% ), Sinusitis (oral inhalation, 1% to 14% )；Serious：Cardiovascular: Death, cardiovascular, Myocardial infarction；Immunologic: Anaphylaxis, Hypersensitivity reaction；Neurologic: Cerebrovascular accident；Respiratory: Bronchospasm','B级',' Infant risk cannot be ruled out.','',0,0),(21,10,'Nasal discharge','(0.03% nasal spray) 6 y of age and older, 2 sprays (42 mcg)/nostril 2 to 3 times/day ；(0.06% nasal spray) 5 to 11 y of age, 2 sprays/nostril (84 mcg) 3 times per day ；(0.06% nasal spray) 12 y of age and older, 2 sprays/nostril (84 mcg) 3 to 4 times per day','','','','','B级',' Infant risk cannot be ruled out.','',0,0),(22,10,'Exacerbation of asthma','','','','','','B级',' Infant risk cannot be ruled out.','',0,0),(23,11,'Asthma','ORAL INHALATION, ages 5 to 11 yr, 40 mcg twice a day; MAX 80 mcg twice a day','','','Hypersensitivity to beclomethasone or any other product component ，Primary treatment of status asthmaticus or other acute asthma episodes requiring intensive measures。','Common：Neurologic: Headache (Adult, aerosol, 2.3%; pediatric, 3.4% ; oral inhalation, 8% to 25% )；Serious：Endocrine metabolic: Secondary hypocortisolism，Immunologic: Hypersensitivity reaction，Ophthalmic: Cataract, Glaucoma，Respiratory: Bronchospasm','C级','Infant risk is minimal.','',0,0),(24,11,'Nasal polyp, recurrence following surgical removal; Prophylaxis','NASAL INHALATION, age 6 to 12 yr, 1 inhalation (42 mcg) in each nostril 2 times per day；NASAL INHALATION, 12 years and older, 1 or 2 inhalations (42 mcg/inhalation) in each nostril 2 times daily (usual dose 168 to 336 mcg/day) ','','','同上','同上','C级','Infant risk is minimal.','',0,0),(25,11,'Rhinitis, Allergic or non-allergic, seasonal or perennial','Qnasl(TM) (4 to 11 years): 1 spray (40 mcg/spray) in each nostril once a day (80 mcg/day)；Qnasl(TM) (12 years or older): 2 sprays (80 mcg/spray) in each nostril once a day (320 mcg/day) ；Beconase AQ(R) (6 to 12 years): 1 inhalation (42 mcg) in each nostril 2 times per day; increase to 2 inhalations in each nostril if not adequately responding and decrease to 1 inhalation in each nostril 2 times per day when controlled ；Beconase AQ(R) (12 years or older): 1 or 2 inhalations (42 mcg/inhalation) in each nostril 2 times daily (usual dose 168 to 336 mcg/day) ','','','同上','同上','C级','Infant risk is minimal.','',0,0),(26,12,'Asthma','For the long-term maintenance treatment of asthma, the recommended dosage in children 12 years and older is 2 oral inhalations twice daily, in the morning and the evening, of either budesonide 80 mcg/formoterol 4.5 mcg or budesonide 160 mcg/formoterol 4.5 mcg per inhalation based on asthma severity. Patients not responding adequately after 1 to 2 weeks of therapy with 2 inhalations of budesonide 80 mcg/formoterol 4.5 mg twice daily may benefit from switching to the higher dosage strength. The maximum daily dose is budesonide 640 mcg/formoterol 18 mcg, which is equivalent to 2 inhalations of budesonide 160 mcg/formoterol 4.5 mcg twice daily ','','','hypersensitivity to budesonide, formoterol, or any component of this product；status asthmaticus or acute episodes of asthma or COPD, primary treatment ','Common：Gastrointestinal: Oral candidiasis (1.4% to 6% ), Stomach ache (1.1% to 6.5% ), Vomiting (1.4% to 3.2% )；Immunologic: Oral candidiasis (1.4% to 3.2% )；Musculoskeletal: Backache (1.6% to 3.2% )；Neurologic: Headache (6.5% to 11.3% )；Respiratory: Nasal congestion (2.5% to 3.2% ), Nasopharyngitis (7.3% to 10.5% ), Pain in throat (6.1% to 8.9% ), Sinusitis (3.5% to 5.8% ), Upper respiratory infection (3.5% to 10.5% )；Other: Influenza (2.4% to 3.2% )；Serious：Endocrine metabolic: Hypokalemia，Ophthalmic: Cataract, Glaucoma, Raised intraocular pressure，Respiratory: Death, asthma-related','C级','Infant risk is minimal.','Long-acting beta(2)-adrenergic agonists (LABA) increase the risk of asthma-related deaths. In a large trial that compared the safety of salmeterol, another LABA, or placebo added to usual asthma therapy, there was an increase in asthma-related deaths with salmeterol. This is considered a LABA class effect. Available data have not determined whether concurrent inhaled corticosteroid or other long-term asthma control drug use mitigates the increased risk of asthma-related death from LABA. Data from pediatric and adolescent trials suggest that LABA increase the risk of asthma-related hospitalization. Therefore, when treating patients with asthma, budesonide/formoterol fumarate should only be used for patients not adequately controlled on a long-term asthma control medication or whose disease severity clearly warrants initiation of treatment with both an inhaled corticosteroid and LABA. Once asthma control is achieved and maintained, assess the patient at regular intervals and step down therapy (eg, discontinue budesonide/formoterol fumarate) if possible without loss of asthma control and maintain the patient on a long-term asthma control medication. Do not use budesonide/formoterol fumarate for patients whose asthma is adequately controlled on low or medium dose inhaled corticosteroids',0,0),(27,13,'Asthma','Pulmicort Flexhaler(TM), age 6 years or older: initial, 180 mcg via ORAL INHALATION twice daily; 360 mcg twice daily may be required initially in some patients; MAX 360 mcg twice daily；Pulmicort Respules(R), age 1 to 8 years (previous therapy bronchodilators alone): initial, 0.5 mg ORAL INHALATION via jet nebulizer once daily or divided twice daily; MAX 0.5 mg/day；Pulmicort Respules(R), age 1 to 8 years (previous therapy inhaled corticosteroids): initial, 0.5 mg ORAL INHALATION via jet nebulizer once daily or divided twice daily; MAX 1 mg/day；Pulmicort Respules(R), age 1 to 8 years (previous oral corticosteroids therapy): initial, 0.5 mg ORAL INHALATION via jet nebulizer twice daily or 1 mg once daily; MAX 1 mg/day','','Hepatic impairment, Child-Pugh Class A (Enterocort(R) EC capsules, Uceris(TM) rectal foam): No adjustment necessary；Hepatic impairment, Child-Pugh Class B (Enterocort(R) EC capsules): Consider dosage reduction ；Hepatic impairment, Child-Pugh Class C (Enterocort(R) EC capsules): Avoid use；Geriatric: Initiate at the low end of the dosing range','Hypersensitivity to budesonide or any component of the product；Severe hypersensitivity to milk protein; lactose in Pulmicort Flexhaler(R) contains trace levels of milk proteins ；Primary treatment of status asthmaticus or other acute episodes of asthma requiring intensive intervention with oral inhalation ','Common：Gastrointestinal: Diarrhea (inhalation, 2% to 4% ; oral, 10% ), Nausea (Inhalation, 1.8% ; oral, 5.1% to 11% ; rectal, 2% )；Musculoskeletal: Arthralgia (oral, 2% to 5% )；Neurologic: Headache (inhalation, greater than 3% ; oral, 11.4% to 21% )；Respiratory: Epistaxis (inhalation, 2% to 4% ; intranasal, 8% ), Nasal stinging/burning (intranasal, less than 1% ), Respiratory tract infection (inhalation, 3% to 38% ; oral, 11% ), Sinusitis (inhalation, 3% or greater ; oral, 8% )。Serious：Cardiovascular: Syncope (inhalation, 1% to 3% )；Endocrine metabolic: Cushing\'s syndrome (oral, 5% to 15% ; inhalation, rare ), Secondary hypocortisolism (Inhalation, rare ; oral, 4.3% ; rectal, 4% )；Immunologic: Anaphylaxis, Hypersensitivity reaction；Musculoskeletal: Fracture of bone (inhalation, 1% to 3% ), Osteoporosis；Ophthalmic: Cataract, Glaucoma；Respiratory: Pneumonia；Other: Angioedema。','Fetal risk cannot be ruled out.','Infant risk is minimal.','',0,0),(28,13,'Autoimmune hepatitis, Without cirrhosis in combination with azathioprine','Age 9 to 17 years, induction, 3 mg orally 3 times daily until biochemical remission or 6 months; administer in combination with azathioprine 1 to 2 mg/kg/day (Off-label dosage)；Age 9 to 17 years, maintenance, 3 mg orally 2 times daily after biochemical remission; administer in combination with azathioprine 1 to 2 mg/kg/day (Off-label dosage)','','同上','同上','同上','同上','同上','',0,0),(29,13,'Crohn\'s disease','(Entocort(R) EC capsules, 8 years or older, greater than 25 kg) 9 mg orally once daily in the morning for up to 8 weeks, followed by 6 mg once daily for 2 weeks','','同上','同上','同上','同上','同上','',0,0),(30,13,'Rhinitis, allergic and non-allergic','(6 years or older) initial, 1 spray/nostril once a day; MAX dose (under 12 years) 2 sprays/nostril once a day; (12 years or older) 4 sprays/nostril once a day','','同上','同上','同上','同上','同上','',0,0),(31,13,'Croup','','','同上','同上','同上','同上','同上','',0,0),(32,13,'Respiratory disease in perinatal period, chronic','','','同上','同上','同上','同上','同上','',0,0),(33,14,'Allergic rhinitis','NASAL INHALATION, 4 years and older, initial, 1 spray/nostril once daily, MAX 2 sprays/nostril daily (200 mcg/day)','','','Hypersensitivity to any component of the product ；Primary treatment of status asthmaticus or other acute episodes of asthma requiring intensive intervention ；Severe hypersensitivity to milk proteins','Common：Gastrointestinal: Candidiasis of mouth and esophagus (Inhalation, 9% or less ), Nausea and vomiting (Inhalation and intranasal, 1% to 8% )；Musculoskeletal: Osteoporosis；Neurologic: Headache (Inhalation and intranasal, 2% to 16.1% )；Respiratory: Cough (Intranasal and inhalation, 1% to 6% ), Epistaxis (Intranasal, 6% to 6.9% ), Pharyngitis (Intranasal, 6% to 7.8% ), Sinusitis (Inhalation, 4% to 10% ), Throat irritation (Inhalation, 3% to 22% ), Upper respiratory infection (Inhalation, 14% to 21% )；Serious：Endocrine metabolic: Se