entration below possible toxicity line on Rumack-Matthew nomogram: Obtain a second level at 8 to 10 hours post-ingestion, use the Rumack-Matthew nomogram to determine need for therapy (FDA dosage) ；(IV) Maintenance dosage, total dosage of IV acetylcysteine is 300 mg/kg as 3 sequential IV infusions over 21 hours. Treatment beyond 21 hours should be considered in cases of massive overdose, concomitant ingestion of other substances, in patients with pre-existing liver disease, if acetaminophen levels are still detectable, or if AST, ALT, or INR remain elevated (FDA dosage) ；(IV, 5 to 20 kg) Loading dose, 150 mg/kg in 3 mL/kg of diluent (D5W, 0.45%NaCl, or sterile water for injection (SWFI)) IV over 1 hour; maintenance, 50 mg/kg in 7 mL/kg of diluent over 4 hours, followed by 100 mg/kg in 14 mL/kg diluent over 16 hours (FDA dosage) ；(IV, 21 to 40 kg) Loading dose, 150 mg/kg in 100 mL of diluent (D5W, 0.45%NaCl, or SWFI) IV over 1 hour; maintenance, 50 mg/kg in 250 mL of diluent over 4 hours, followed by 100 mg/kg in 500 mL of diluent over 16 hours (FDA dosage) ；(IV, 41 to 99 kg) Loading dose, 150 mg/kg in 200 mL of compatible solution (D5W, 0.45%NaCl, or SWFI) IV over 1 hour; maintenance, 50 mg/kg in 500 mL of diluent over 4 hours, followed by 100 mg/kg in 1000 mL of diluent over 16 hours (FDA dosage) ；(IV, 100 kg or greater) Loading dose, 15,000 mg in 200 mL of diluent (D5W, 0.45%NaCl, or SWFI) IV over 1 hour; maintenance, 5000 mg in 500 mL of diluent over 4 hours, followed by 10,000 mg in 1000 mL of diluent over 16 hours; limited information is available regarding dosing requirements in patients that weigh more than 100 kg (FDA dosage) ；(IV, modified protocol) Loading dose, 100 mg/kg in 200 mL of 5% dextrose IV over 2 hours, then 200 mg/kg in 1 L of 5% dextrose over 10 hours; additional dosing if clinically indicated (off-label dosage) ；OR loading dose, 200 mg/kg over 4 hours followed by 100 mg/kg over 16 hours (off-label dosage) ；(Oral) Initial, 140 mg/kg orally, then 70 mg/kg every 4 hours for 17 doses starting 4 hours after loading dose (FDA dosage) 。','','','Hypersensitivity to acetylcysteine ;Specific contraindications have not been determined for the oral effervescent tablets.','Common：Dermatologic: Pruritus (1% to 3% ), Rash (4% to 5% ), Urticaria；Gastrointestinal: Diarrhea, Nausea (2% to 7% ), Vomiting (9% to 12% )；Serious：Cardiovascular: Decreased cardiac function, Electrocardiogram abnormal, Hypervolemia；Immunologic: Anaphylactoid reaction (0.1% to 0.2% ), Hypersensitivity reaction (Adult, 8% to 18%; pediatric, 10% )；Neurologic: Status epilepticus；Respiratory: Bronchospasm, Respiratory distress。','Fetal risk cannot be ruled out','Micromedex: Infant risk cannot be ruled out.','',0,0),(83,25,'Administration of anesthesia for procedure','nebulization into a face mask, mouth piece, or tracheostomy: 1 to 10 mL of the 20% solution or 2 to 20 mL of the 10% solution every 2 to 6 hours; usual dose is 3 to 5 mL of the 20% solution or 6 to 10 mL of the 10% solution 3 to 4 times daily ；nebulization into a tent or croupette: individualize treatment; use the volume of the 10% or 20% solution that will maintain a very heavy mist in the tent or croupette；direct instillation into tracheostomy: 1 to 2 mL of a 10% or 20% solution may be given as often as every hour; usual dose is 1 to 2 mL of a 10% or 20% solution every 1 to 4 hours ；percutaneous intratracheal catheter: 1 to 2 mL of 20% solution or 2 to 4 mL of 10% solution every 1 to 4 hours via a syringe attached to the catheter；intratracheal catheter into particular bronchopulmonary tree segment: 2 to 5 mL of the 20% solution via a syringe attached to the catheter。','','','同上','同上','','','',0,0),(84,25,'Atelectasis, Due to mucous obstruction','nebulization into a face mask, mouth piece, or tracheostomy: 1 to 10 mL of the 20% solution or 2 to 20 mL of the 10% solution every 2 to 6 hours; usual dose is 3 to 5 mL of the 20% solution or 6 to 10 mL of the 10% solution 3 to 4 times daily；ne