days via intravenous infusion。','','',' Absolute contraindications and precautions to this agent have not been determined; no information found at the time of this review','Contact dermatitis，Pruritus，Rash，Urticaria，Constipation，Diarrhea，Excessive salivation，Gastrointestinal tract finding，Nausea and vomiting，Xerostomia，Dysuria，Urogenital finding，Nasal discharge，Fatigue。','Fetal risk cannot be ruled out','Infant risk cannot be ruled out.','',0,0),(93,27,'Oral route','Recommended oral doses are as follows: children up to 2 years - 15 milligrams (mg) daily; children ages 2 to 5 years - 15 to 30 mg daily; children 5 to 12 years - 30 to 45 mg daily and children 12 years and older - 60 to 90 mg daily；As a mucolytic, oral ambroxol has been given to children in doses of 1.5 to 2 milligrams/kilogram/day in 2 divided doses。','','','同上','同上','同上','同上','',0,0),(94,27,'Otitis media','AMBROXOL produced improvement of symptoms in 413 adult and pediatric patients with SECRETORY OTITIS MEDIA in a multicenter, placebo-controlled, double-blind trial (Passali et al, 1987). Patients were randomized to receive oral AMBROXOL (30 milligrams 3 times a day in adults; 9 milligrams 4 times a day in children) or placebo for 15 days. Concurrent antibiotic therapy was allowed. At the end of the 15-day study period, the group treated with AMBROXOL showed definite improvement. In the ambroxol-treated group, patients reporting serious occlusion of the ear dropped from 22.1% to 3.2% and those reporting a \"fair\" degree of occlusion fell from 51.7% to 14.3%. With placebo, serious occlusion fell from 13.8% to 5%, and fair occlusion fell from 59.2% to 24.3%. The difference was statistically significant. Other parameters measured showed no significant difference between groups except audiometry and overall improvement, which were significantly improved over placebo at the end of the study. AMBROXOL was of benefit in the treatment of secretory otitis media.','','','同上','同上','同上','同上','',0,0),(95,27,'Respiratory distress syndrome in the newborn','Efficacy: Pediatric, Evidence is inconclusive；Recommendation: Pediatric, Class II','','','同上','同上','同上','同上','',0,0),(96,27,'Respiratory distress syndrome in the newborn; Prophylaxis','Efficacy: Pediatric, Evidence is inconclusive；Strength of Evidence: Pediatric, Category B','','','同上','同上','同上','同上','',0,0),(99,30,'Fever','(Oral, infants and children, less than 60 kg) 10 to 15 mg/kg/dose orally every 4 to 6 hours; MAX 75 mg/kg/day for infants and lesser of 100 mg/kg/day or 1625 mg/day in children ；(Oral, adolescents, 60 kg or greater) 650 to 1000 mg orally every 4 to 6 hours as needed; MAX 3250 mg/day;(IV, 2 to 12 years) 15 mg/kg IV every 6 hours or 12.5 mg/kg IV every 4 hours; may be administered as a single or repeated dose; minimum dosing interval, 4 hours; MAX single dose 15 mg/kg or 750 mg; MAX daily dosage 75 mg/kg/day or 3750 mg/24 hours;(IV, 13 years or older, less than 50 kg) 15 mg/kg IV every 6 hours or 12.5 mg/kg IV every 4 hours; may be administered as a single or repeated dose; minimum dosing interval, 4 hours; MAX single dose 15 mg/kg or 750 mg; MAX daily dosage 75 mg/kg/day or 3750 mg/24 hours;(IV, 13 years or older, 50 kg or greater) 1000 mg IV every 6 hours, or 650 mg IV every 4 hours; may be administered as a single or repeated dose; minimum dosing interval, 4 hours; MAX single dose 1000 mg; MAX daily dosage 4000 mg/24 hours;(Rectal, infants and children, less than 60 kg) 10 to 20 mg/kg rectally every 4 to 6 hours as needed; MAX: 75 mg/kg/day for infants and lesser of 100 mg/kg/day or 4000 mg/day in children; loading dose of 25 to 45 mg/kg (MAX 1000 mg) may also be given prior to maintenance dosing;(Rectal, adolescents, 60 kg or greater) 650 mg rectally every 4 to 6 hours as needed; MAX: 4000 mg/day (guideline dosage) .','renal impairment, severe (GFR less than 10 mL/min): increase dosing interval to every 8 hours for adults and children;(CrCl 30 mL/min or less) a longer dosing interval and a reduced total daily dose may be warranted;renal impairment, moderate (GFR 10 to 50 mL/min): adult, increase dosing interval to every 6 hours; pediatric, give usual weight- or age-based dose;renal impairment, mild (GFR greater than 50 mL/min): adult, increase dosing interval to every 4 hours; pediatric, give usual weight- or age-based dose ;dialysis: supplemental doses not required following hemodialysis or peritoneal dialysis','hepatic impairment, severe, including active liver disease: use is contraindicated;hepatic impairment: reduction of the total daily dose may be warranted;','Active and severe hepatic disease；Hypersensitivity to acetaminophen or any other components of the product；Severe hepatic impairment','Common：Dermatologic: Pruritus (5% or greater )；Gastrointestinal: Constipation (5% or greater ), Nausea (adult, 34%; pediatric, 5% or greater ), Vomiting (adult, 15%; pediatric, 5% or greater )；Neurologic: Headache (1% to 10% ), Insomnia (1% to 7% )；Psychiatric: Agitation (5% or greater )；Respiratory: Atelectasis (5% or greater )；Serious：Dermatologic: Acute generalized exanthematous pustulosis, Stevens-Johnson syndrome, Toxic epidermal necrolysis；Hepatic: Liver failure；Respiratory: Pneumonitis。','c级','Infant risk is minimal.','Prevent acetaminophen injection dosing errors, which may result in accidental overdose and death, by confirming that doses in milligrams (mg) are not confused with doses in milliliters (mL); that patients under 50 kg receive weight-based doses; that infusion pumps are programmed correctly; and that the total dose of acetaminophen from all routes and from all sources does not exceed daily limits. Life-threatening cases of acute hepatic failure leading to liver transplant or death have been linked with acetaminophen use. In most cases of hepatic injury, acetaminophen doses exceeded maximum daily limits and often involved the use of more than 1 acetaminophen-containing product ',0,0),(100,30,' \nPain (Mild to Moderate)','(Oral, infants and children, less than 60 kg) 10 to 15 mg/kg/dose orally every 4 to 6 hours; MAX 75 mg/kg/day for infants and lesser of 100 mg/kg/day or 1625 mg/day in children ;(Oral, adolescents, 60 kg or greater) 650 to 1000 mg orally every 4 to 6 hours as needed; MAX 3250 mg/day;(IV, 2 to 12 years) 15 mg/kg IV every 6 hours or 12.5 mg/kg IV every 4 hours; may be administered as a single or repeated dose; minimum dosing interval, 4 hours; MAX single dose 15 mg/kg or 750 mg; MAX daily dosage 75 mg/kg/day or 3750 mg/24 hours;(IV, 13 years or older, less than 50 kg) 15 mg/kg IV every 6 hours or 12.5 mg/kg IV every 4 hours; may be administered as a single or repeated dose; minimum dosing interval, 4 hours; MAX single dose 15 mg/kg or 750 mg; MAX daily dosage 75 mg/kg/day or 3750 mg/24 hours;(IV, 13 years or older, 50 kg or greater) 1000 mg IV every 6 hours OR 650 mg IV every 4 hours; may be administered as a single or repeated dose; minimum dosing interval, 4 hours; MAX single dose 1000 mg; MAX daily dosage 4000 mg/24 hours;(Rectal, infants and children, less than 60 kg) 10 to 20 mg/kg rectally every 4 to 6 hours as needed; MAX: 75 mg/kg/day for infants and lesser of 100 mg/kg/day or 4000 mg/day in children; loading dose of 25 to 45 mg/kg (maximum 1000 mg) may also be given prior to maintenance dosing ;(Rectal, adolescents, 60 kg or greater) 650 mg rectally every 4 to 6 hours as needed; MAX: 4000 mg/day (guideline dose)','同上','同上','同上','同上','','','同上',0,0),(101,30,'Pain (Moderate to Severe), In combination with opioid medications','(2 to 12 years) 15 mg/kg IV every 6 hours or 12.5 mg/kg IV every 4 hours; may be administered as a single or repeated dose; minimum dosing interval, 4 hours; MAX single dose 15 mg/kg or 750 mg; MAX daily dosage 75 mg/kg/day or 3750 mg/24 hours;(13 years or older, less than 50 kg) 15 mg/kg IV every 6 hours or 12.5 mg/kg IV every 4 hours; may be administered as a single or repeated dose; minimum dosing interval, 4 hours; MAX single dose 15 mg/kg or 750 mg; MAX daily dosage 75 mg/kg/day or 3750 mg/24 hours ;(13 years or older, 50 kg or greater) 1000 mg IV every 6 hours or 650 mg IV every 4 hours; may be administered as a single or repeated dose; minimum dosing interval, 4 hours; MAX single dose 1000 mg; MAX daily dosage 4000 mg/24 hours.','同上','同上','同上','同上','','','同上',0,0),(102,30,'Vaccines adverse reaction; Prophylaxis','(2 to 6 months of age) Diphtheria-pertussis-tetanus toxoids-polio vaccine: 15 mg/kg orally following vaccination, followed by 2 further doses at 4-hour intervals, with subsequent doses given as needed (off-label dosage) ','同上','同上','同上','同上','','','同上',0,0),(104,32,'Acute otitis media','1) Recurrent or Persistent Infections (Augmentin ES-600(R))：a) For recurrent or persistent acute otitis media in children ages 3 months and older, amoxicillin/clavulanate suspension (600 mg/5 mL strength) at a dose of 90 mg/kg/day (based on amoxicillin component) orally divided every 12 hours for 10 days is recommended；2) Suspension and Chewable Tablets (under 40 kg)：a) In infants less than 3 months of age, the recommended dose of amoxicillin/clavulanate suspension (125 mg/5 mL strength recommended) is 30 mg/kg/day (based on amoxicillin component) orally divided every 12 hours；b) In children 3 months and older and weighing under 40 kg, the recommended dose of amoxicillin/clavulanate suspension (200 mg/5 mL) and 400 mg/5 mL) or chewable tablets (200 mg and 400 mg) is 25 to 45 mg/kg/day (based on amoxicillin component) orally divided every 12 hours for 10 days, depending on severity of infection. The recommended dose of the 125 mg/5 mL and 250 mg/5 mL suspensions or the 125 mg and 250 mg chewable tablets in children 3 months and older and weighing under 40 kg is 20 to 40 mg/kg/day (based on amoxicillin component) orally divided every 8 hours for 10 days, depending on severity of infection；3) Suspension and Immediate-Release Tablets (40 kg and greater)：a) For mild to moderate infections, the recommended dose of amoxicillin/clavulanate in children 40 kg and greater is 500 mg (amoxicillin component) orally every 12 hours or 250 mg (amoxicillin component) orally every 8 hours. For severe infections in children over 40 kg, the recommended dose is 875 mg (amoxicillin component) orally every 12 hours or 500 mg (amoxicillin component) orally every 8 hours ； For patients with difficulty swallowing, the 125 mg/5 mL or 250 mg/5 mL suspension may be used in place of the 500 mg tablet. The 200 mg/5 mL suspension or the 400 mg/5 mL suspension may be used in place of the 875 mg tablet 。','No renal dosing adjustments are available from the manufacturer for children with renal failure; however, dosage adjustments are recommended for adults with renal failure [1]. For pediatric patients weighing 40 kg and greater and receiving the adult dosage, the following are recommendations for dose adjustments in renal failure: for patients with a creatinine clearance of 10 to 30 mL/min, the suggested dose is 250 mg to 500 mg amoxicillin/125 mg clavulanic acid every 12 hours; for patients with a creatinine clearance less than 10 mL/min, the suggested dose is 250 or 500 mg amoxicillin/125 mg clavulanic acid every 24 hours. The extended-release (1000 mg) and 875-mg tablets are not recommended in patients with a creatinine clearance less than 30 mL/min ','Amoxicillin/clavulanate should be used with caution in patients with hepatic impairment; hepatic function should be monitored with prolonged therapy。Dosage Adjustment During Dialysis：For pediatric patients weighing 40 kg and greater who are receiving the adult dosage and are on hemodialysis, the following doses are recommended: a maintenance dose of 250 or 500 mg amoxicillin/125 mg clavulanic acid every 24 hours, with a supplemental dose given both during and at the end of dialysis ；The extended-release (1000 mg amoxicillin component) and 875-mg tablets are not recommended for patients receiving hemodialysis ；Based upon the pharmacokinetic pattern of intravenous Augmentin(R