te of intravenous dextrose should be individualized and is dependent upon the age, weight and clinical condition of the patient. Particular caution should be exercised in pediatric patients, particularly neonates and low birth weight infants ','','','同上','同上','同上','同上','',0,0),(365,56,'Oral rehydration therapy','a) In industrial countries, oral rehydration therapy (ORT) has been used for infants following intravenous therapy or for hydrated infants with early diarrhea. In developing countries and in analogous situations in industrial countries, such as inner cities or Indian reservations in the United States, it is used for infants and children with all kinds of diarrheal dehydration. Vomiting does not interfere with the success of ORT；b) Reconstituted oral rehydration solutions should not be stored for longer than 24 hours at room temperature because of the possibility of bacterial contamination and proliferation which could be hazardous to children. However, one study found that the concentration of bicarbonate was adequate for the solution to be stored up to a week at room temperature ；c) The approved WHO oral rehydration formulation consists of 90 mEq/L of sodium, 20 mEq/L of potassium, 80 mEq/L of chloride, 30 mEq of bicarbonate, and 111 mM/L of glucose (dextrose). On the first day, the dose consists of one feeding of plain water for each two of oral rehydration solution in equal volume. Breast milk and plain water are given in increasing amounts on subsequent days ','','','同上','同上','同上','同上','',0,0),(366,57,'Intravenous route;Hypoglycemia;','a) NEONATES:1) 250 to 500 milligrams dextrose/kilogram/dose (5 to 10 milliliters of 25% dextrose) ;b) INFANTS (or severe cases): Larger or repeated single doses up to 10 or 12 milliliters of 25% dextrose may be required. Follow with continuous intravenous infusion of 10% dextrose to stabilize blood glucose levels;SOLUTION CHOICE:a) Dextrose 2.5%, 5%, and 10%: Intravenous infusion for fluid and caloric replacement ;b) Dextrose 20% (hypertonic): Intravenous infusion for caloric replacement with a minimum of fluids;c) Dextrose 25% (hypertonic): Intravenous treatment for acute hypoglycemia in the neonate or older infant ;d) Dextrose 50% (hypertonic): Administer dose intravenously for the treatment of insulin induced hypoglycemia (hyperinsulinemia or insulin shock) ;','','','simultaneous administration with blood through same infusion set; avoid due to possibility for pseudoagglutination of red cells (IV) ','Cardiovascular Effects：Peripheral edema；Dermatologic Effects；Injection site extravasation；Injection site infection；Injection site thrombosis；Phlebitis；Endocrine/Metabolic Effects：Disorder of fluid AND/OR electrolyte；Fast metabolic rate；Hyperglycemia；Hyperosmolarity；Hypervolemia；Hypoglycemia；Increased insulin level；Increased norepinephrine level；Immunologic Effects：Anaphylaxis；Neurologic Effects：Cerebral hemorrhage：Cerebral ischemia；Respiratory Effects:Pulmonary edema;Fever','Category C (All Trimesters)','Infant risk cannot be ruled out.','',0,0),(367,57,'Oral route','1) Do not administer to children under 2 years of age unless otherwise directed by a physician;2) Direct absorption of dextrose from the intestine results in a rapid increase in blood glucose concentration. Dextrose is effective in small doses and provides 3.4 to 4 calories/gram (glucose monohydrate 1 gram is approximately equal to 1 gram of anhydrous dextrose) ;','','','同上','同上','同上','同上','',0,0),(368,57,'Intravenous feeding of patient','1) The dosage and infusion rate of intravenous dextrose should be individualized and is dependent upon the age, weight and clinical condition of the patient. Particular caution should be exercised in pediatric patients, particularly neonates and low birth weight infants ;','','','同上','同上','同上','同上','',0,0),(369,57,'Glucose tolerance test','Pediatric, Class IIa','','','同上','同上','同上','同上','',0,0),(370,57,'Hypoglycemia; Prophylaxis - Surgical procedure','Pediatric, Class IIb','','','同上','同上','同上','同上','',0,0),(371,57,'Oral rehydration therapy','Pediatric:a) In industrial countries, oral rehydration therapy (ORT) has been used for infants following intravenous therapy or for hydrated infants with early diarrhea. In developing countries and in analogous situations in industrial countries, such as inner cities or Indian reservations in the United States, it is used for infants and children with all kinds of diarrheal dehydration. Vomiting does not interfere with the success of ORT ;b) Reconstituted oral rehydration solutions should not be stored for longer than 24 hours at room temperature because of the possibility of bacterial contamination and proliferation which could be hazardous to children. However, one study found that the concentration of bicarbonate was adequate for the solution to be stored up to a week at room temperature ;c) The approved WHO oral rehydration formulation consists of 90 mEq/L of sodium, 20 mEq/L of potassium, 80 mEq/L of chloride, 30 mEq of bicarbonate, and 111 mM/L of glucose (dextrose). On the first day, the dose consists of one feeding of plain water for each two of oral rehydration solution in equal volume. Breast milk and plain water are given in increasing amounts on subsequent days;','','','同上','同上','同上','同上','',0,0),(372,57,'Sclerotherapy','Pediatric, Class III','','','同上','同上','同上','同上','',0,0),(373,58,'Hypokalemia','Not for use in pediatric patients ,safety and efficacy not established.0.5 to 0.75 mEq/kg IV infused over 1 to 2 hours; then reassess (study dose) ;3 to 8 mEq/kg/day ORALLY,divided 1 to 5 times per day depending on tolerability and dose; start at lower dose and adjust based on serum potassium concentrations (study dose).','IV use is contraindicated ;use caution with oral formulations because of risk of hyperkalemia;','','anticholinergic agents; gastrointestinal tract passage restrictions or delay may inhibit extended-release tablet passage;cardiac patients with esophageal compression; extended-release tab