DROP TABLE IF EXISTS `gzh_menu`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `gzh_menu` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '菜单id',
  `menu_url` varchar(255) NOT NULL DEFAULT '' COMMENT '菜单url',
  `type` tinyint(4) DEFAULT '0' COMMENT '类型(1-渲染左侧菜单栏，0-不渲染)',
  `description` varchar(255) NOT NULL DEFAULT '' COMMENT '描述',
  `parent_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '父级模块id',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '状态(0-不显示，1-显示)',
  `role_type` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '判断是否是超级管理员(1-是，0-不是)',
  `sort` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `create_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `menu_url` (`menu_url`),
  KEY `parent_id` (`parent_id`),
  KEY `type` (`type`,`status`),
  KEY `role_type` (`role_type`),
  KEY `status` (`status`),
  CONSTRAINT `gzh_menu_title_id` FOREIGN KEY (`parent_id`) REFERENCES `gzh_title` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=254 DEFAULT CHARSET=utf8 COMMENT='菜单表';
/*!40101 SET character_set_client = @saved_cs_client */;

