DROP TABLE IF EXISTS `gzh_order`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `gzh_order` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `record_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '流水ID',
  `spot_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '诊所ID',
  `user_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '操作人ID',
  `type` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '订单类型(1-微信,2-支付宝)',
  `out_trade_no` varchar(64) NOT NULL DEFAULT '' COMMENT '订单号',
  `subject` varchar(255) NOT NULL DEFAULT '' COMMENT '订单名称',
  `total_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '支付总金额(本次交易支付的订单金额，单位为人民币（元）)',
  `discount_type` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '优惠方式(1-无,2-金额扣减,3-折扣%)',
  `discount_price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '优惠金额/优惠折扣',
  `discount_reason` varchar(255) NOT NULL DEFAULT '' COMMENT '优惠理由',
  `status` tinyint(4) unsigned NOT NULL DEFAULT '1' COMMENT '订单支付状态[ 1-待支付,2-支付成功,3-支付失败 ,4-已退款,5-已过期]',
  `create_time` int(11) unsigned NOT NULL DEFAULT '0',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  UNIQUE KEY `out_trade_no` (`out_trade_no`) USING BTREE,
  KEY `type` (`type`),
  KEY `record_id` (`record_id`,`spot_id`),
  KEY `total_amount` (`total_amount`)
) ENGINE=InnoDB AUTO_INCREMENT=451 DEFAULT CHARSET=utf8 COMMENT='订单表';
/*!40101 SET character_set_client = @saved_cs_client */;

