CREATE TABLE `gzh_patient_family` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `patient_id` int(10) unsigned NOT NULL COMMENT '患者id',
  `relation` tinyint(3) unsigned NOT NULL COMMENT '成员关系',
  `name` varchar(64) NOT NULL DEFAULT '' COMMENT '成员姓名',
  `sex` tinyint(3) unsigned NOT NULL DEFAULT '3' COMMENT '性别(1-男,2-女,3-不祥)',
  `birthday` int(10) unsigned NOT NULL COMMENT '出生日期',
  `iphone` char(11) NOT NULL DEFAULT '' COMMENT '手机号',
  `create_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  `card` varchar(20) NOT NULL DEFAULT '' COMMENT '身份证号码',
  PRIMARY KEY (`id`),
  KEY `patient_id` (`patient_id`),
  CONSTRAINT `gzh_patient_family_ibfk_1` FOREIGN KEY (`patient_id`) REFERENCES `gzh_patient` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=205 DEFAULT CHARSET=utf8 COMMENT='患者家庭成员表';
