--
-- Table structure for table `gzh_patient_record`
--

DROP TABLE IF EXISTS `gzh_patient_record`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `gzh_patient_record` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `spot_id` int(10) unsigned NOT NULL COMMENT '诊所ID',
  `patient_id` int(10) unsigned NOT NULL COMMENT '患者id',
  `case_id` varchar(20) DEFAULT '' COMMENT '门诊病案号',
  `check_price` decimal(20,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '辅助检查总费用',
  `cure_price` decimal(20,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '治疗总费用',
  `inspect_price` decimal(20,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '实验室检查总费用',
  `recipe_price` decimal(20,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '处方总费用',
  `completed_price` decimal(20,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '已收费金额',
  `price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '诊疗费用',
  `fee_remarks` varchar(64) NOT NULL DEFAULT '' COMMENT '诊疗费收费备注',
  `reference_cost` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '结束就诊-参考费用',
  `type` tinyint(3) unsigned NOT NULL COMMENT '就诊类型(1-初诊,2-复诊)',
  `type_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '预约类型时间',
  `status` tinyint(3) unsigned NOT NULL COMMENT '就诊状态( 1- ''已预约'',2-''已登记'',3 -''已分诊'', 4- ''接诊中'',5- ''接诊结束'', 6 - ''失约'',7-''已取消'')',
  `end_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '结束就诊时间',
  `makeup` tinyint(4) unsigned NOT NULL DEFAULT '1' COMMENT '补录【1非补录 2补录】',
  `create_time` int(10) unsigned NOT NULL COMMENT '创建时间',
  `update_time` int(10) unsigned NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `patient_id` (`patient_id`),
  KEY `spot_id` (`spot_id`),
  KEY `status` (`status`),
  KEY `create_time` (`create_time`)
) ENGINE=InnoDB AUTO_INCREMENT=619 DEFAULT CHARSET=utf8 COMMENT='患者就诊流水表';
/*!40101 SET character_set_client = @saved_cs_client */;

