DROP TABLE IF EXISTS `gzh_payment_log`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `gzh_payment_log` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `out_trade_no` varchar(64) NOT NULL DEFAULT '' COMMENT '订单编号',
  `buyer_id` varchar(64) NOT NULL DEFAULT '' COMMENT '买家用户号',
  `buyer_logon_id` varchar(255) DEFAULT '' COMMENT '买家账号',
  `seller_id` varchar(64) NOT NULL DEFAULT '' COMMENT '卖家用户号',
  `seller_email` varchar(255) NOT NULL DEFAULT '' COMMENT '卖家账号',
  `total_amount` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '订单总金额(本次交易支付的订单金额，单位为人民币（元）)',
  `receipt_amount` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '实收金额(商家在交易中实际收到的款项，单位为元)',
  `buyer_pay_amount` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '付款金额(用户在交易中支付的金额)',
  `refund_fee` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '总退款金额(退款通知中，返回总退款金额，单位为元)',
  `send_back_fee` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '实际退款金额(商户实际退款给用户的金额，单位为元)',
  `payment_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '交易付款时间',
  `refund_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '交易退款时间',
  `close_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '交易结束时间',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '订单支付状态[ 1-待支付,2-支付成功,3-支付失败 ,4-已退款]',
  `transaction_id` varchar(32) NOT NULL DEFAULT '' COMMENT '支付交易号',
  `pay_type` tinyint(4) unsigned NOT NULL DEFAULT '2' COMMENT '[1 微信 2支付宝]',
  `create_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `out_trade_no` (`out_trade_no`) USING BTREE,
  CONSTRAINT `gzh_payment_log_ibfk_1` FOREIGN KEY (`out_trade_no`) REFERENCES `gzh_order` (`out_trade_no`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

