-- Table structure for table `gzh_recipe_record`
--

DROP TABLE IF EXISTS `gzh_recipe_record`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `gzh_recipe_record` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `record_id` int(10) unsigned NOT NULL COMMENT '流水ID',
  `spot_id` int(10) unsigned NOT NULL COMMENT '诊所ID',
  `recipe_id` int(10) unsigned NOT NULL COMMENT '处方id',
  `name` varchar(64) NOT NULL DEFAULT '' COMMENT '处方名称',
  `product_name` varchar(64) NOT NULL DEFAULT '' COMMENT '商品名',
  `en_name` varchar(64) NOT NULL DEFAULT '' COMMENT '英文名称',
  `specification` varchar(64) NOT NULL DEFAULT '' COMMENT '规格',
  `price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '零售价',
  `dose` decimal(10,2) unsigned NOT NULL COMMENT '剂量',
  `dose_unit` int(10) unsigned NOT NULL COMMENT '剂量单位',
  `used` tinyint(3) unsigned NOT NULL COMMENT '用法(1-口服,2-注射)',
  `frequency` tinyint(3) unsigned NOT NULL COMMENT '用药频次(1-每天一次,2-每天二次,3-每天三次)',
  `day` int(10) unsigned NOT NULL COMMENT '天数',
  `num` int(10) unsigned NOT NULL COMMENT '数量',
  `unit` int(11) NOT NULL COMMENT '单位(1-袋,2-片)',
  `dosage_form` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '剂型',
  `description` varchar(255) NOT NULL DEFAULT '' COMMENT '说明',
  `type` tinyint(3) unsigned NOT NULL COMMENT '类型(1-本院,2-外购)',
  `remark` varchar(255) NOT NULL DEFAULT '' COMMENT '备注',
  `skin_test_status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否需要皮试(0-没，1-是,2-否)',
  `skin_test` varchar(64) NOT NULL DEFAULT '' COMMENT '皮试内容',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '3' COMMENT '状态(1-已完成,2-执行中,3-未执行)',
  `recipe_finish_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '发药完成中状态变更时间',
  `report_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '报告时间',
  `report_user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '报告人',
  `medicine_description_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '用药指南id',
  `create_time` int(10) unsigned NOT NULL COMMENT '创建时间',
  `update_time` int(10) unsigned NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `record_id` (`record_id`,`spot_id`),
  KEY `status` (`status`),
  KEY `recipe_id` (`recipe_id`),
  KEY `create_time` (`create_time`),
  KEY `report_user_id` (`report_user_id`),
  KEY `medicine_description_id` (`medicine_description_id`)
) ENGINE=InnoDB AUTO_INCREMENT=324 DEFAULT CHARSET=utf8 COMMENT='门诊-处方信息表';
/*!40101 SET character_set_client = @saved_cs_client */;

