DROP TABLE IF EXISTS `gzh_recipelist`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `gzh_recipelist` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `spot_id` int(10) unsigned NOT NULL COMMENT '机构ID',
  `medicine_description_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '用药指南表id',
  `name` varchar(64) NOT NULL DEFAULT '' COMMENT '医嘱名称',
  `product_name` varchar(64) NOT NULL DEFAULT '' COMMENT '商品名',
  `en_name` varchar(64) NOT NULL DEFAULT '' COMMENT '英文名称',
  `specification` varchar(64) NOT NULL DEFAULT '' COMMENT '规格',
  `unit` varchar(16) NOT NULL DEFAULT '' COMMENT '包装单位(1-盒,2-袋,3-瓶,4-支,5-贴,6-片,7-粒,8-板)',
  `type` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '剂型',
  `price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '零售价',
  `default_price` decimal(10,2) DEFAULT NULL COMMENT '成本价',
  `manufactor` varchar(64) NOT NULL DEFAULT '' COMMENT '生产厂家',
  `app_number` varchar(64) NOT NULL DEFAULT '' COMMENT '国药准字',
  `drug_type` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '药品分类',
  `medicine_code` varchar(64) NOT NULL DEFAULT '' COMMENT '上药编码',
  `meta` varchar(16) NOT NULL DEFAULT '' COMMENT '拼音码',
  `product_batch` varchar(64) NOT NULL DEFAULT '' COMMENT '产品批次',
  `address` varchar(64) NOT NULL DEFAULT '' COMMENT '取药地点',
  `default_used` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '默认用法',
  `default_frequency` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '默认频次',
  `default_consumption` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '默认用量',
  `bar_code` varchar(64) NOT NULL DEFAULT '' COMMENT '药品条形码',
  `international_code` varchar(16) NOT NULL DEFAULT '' COMMENT '国际编码',
  `skin_test_status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否需要皮试(0-没，1-是)',
  `skin_test` varchar(64) NOT NULL DEFAULT '' COMMENT '皮试内容',
  `remark` varchar(64) NOT NULL DEFAULT '' COMMENT '备注',
  `status` int(11) NOT NULL DEFAULT '1' COMMENT '状态(1-正常,2-停用)',
  `create_time` int(10) unsigned NOT NULL COMMENT '创建时间',
  `update_time` int(10) unsigned NOT NULL COMMENT '更新时间',
  `dose_unit` varchar(64) NOT NULL DEFAULT '0' COMMENT '剂量单位',
  `insurance` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否医保 1.是2.否',
  PRIMARY KEY (`id`),
  KEY `spot_id` (`spot_id`),
  KEY `status` (`status`),
  KEY `medicine_description_id` (`medicine_description_id`),
  FULLTEXT KEY `name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=109 DEFAULT CHARSET=utf8 COMMENT='处方医嘱配置表';
