CREATE TABLE `gzh_spot` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` varchar(64) NOT NULL DEFAULT '' COMMENT '创建该站点的用户user_id',
  `spot` varchar(32) NOT NULL DEFAULT '' COMMENT '机构/诊所编码',
  `spot_name` varchar(255) NOT NULL DEFAULT '' COMMENT '机构/诊所名称',
  `parent_spot` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '父级机构id',
  `type` tinyint(3) unsigned NOT NULL DEFAULT '2' COMMENT '类型(1-机构,2-诊所)',
  `appointment_type` varchar(10) NOT NULL DEFAULT '1' COMMENT '1-医生预约，2-科室预约',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '1-正常,2-禁用',
  `template` varchar(64) NOT NULL DEFAULT '' COMMENT '初始化的模板',
  `contact_iphone` char(11) NOT NULL DEFAULT '' COMMENT '联系人手机',
  `contact_name` varchar(32) NOT NULL DEFAULT '' COMMENT '联系人',
  `contact_email` varchar(32) NOT NULL DEFAULT '' COMMENT '联系人邮箱',
  `province` varchar(32) NOT NULL DEFAULT '' COMMENT '省份',
  `city` varchar(32) NOT NULL DEFAULT '' COMMENT '城市',
  `area` varchar(32) NOT NULL DEFAULT '' COMMENT '地区',
  `detail_address` varchar(64) NOT NULL DEFAULT '' COMMENT '地址',
  `fax_number` varchar(32) NOT NULL DEFAULT '' COMMENT '传真',
  `telephone` varchar(32) NOT NULL DEFAULT '' COMMENT '电话',
  `icon_url` varchar(64) NOT NULL DEFAULT '' COMMENT '图标',
  `create_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `spot` (`spot`),
  KEY `parent_spot` (`parent_spot`),
  KEY `status` (`status`) USING BTREE,
  KEY `parent_spot_2` (`parent_spot`,`status`),
  KEY `type` (`type`)
) ENGINE=InnoDB AUTO_INCREMENT=49 DEFAULT CHARSET=utf8 COMMENT='站点信息表';
