DROP TABLE IF EXISTS `gzh_stock_info`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `gzh_stock_info` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `spot_id` int(10) unsigned NOT NULL COMMENT '诊所ID',
  `stock_id` int(10) unsigned NOT NULL COMMENT '库存公共信息ID',
  `recipe_id` int(10) unsigned NOT NULL COMMENT '处方ID',
  `total_num` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '总库存量',
  `num` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '剩余数量',
  `default_price` decimal(10,2) DEFAULT NULL COMMENT '成本价',
  `batch_number` varchar(64) NOT NULL DEFAULT '' COMMENT '批号',
  `expire_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '有效期',
  `create_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `stock_id` (`stock_id`),
  KEY `recipe_id` (`recipe_id`),
  KEY `spot_id` (`spot_id`),
  CONSTRAINT `gzh_stock_info_ibfk_1` FOREIGN KEY (`stock_id`) REFERENCES `gzh_stock` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `gzh_stock_info_ibfk_2` FOREIGN KEY (`recipe_id`) REFERENCES `gzh_recipelist` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=129 DEFAULT CHARSET=utf8 COMMENT='药房库存信息详情表';
